import React from 'react'
import {Navbar,Container, Badge, NavbarBrand} from 'react-bootstrap'
// import './Navbar.css'


function Navbars() {
    return (
        <Navbar bg="dark" expand="lg" text="light">
            <Container>
                <NavbarBrand><i>Instagram</i></NavbarBrand>

            </Container>
        </Navbar>
        
    )
}

export default Navbars
